VertX JUnit 5 MongoDB test does not complete (TimeoutException) or completes too early (testContext.awaitCompletion not working)<p><strong>Background:</strong></p>

<p>During migration from JUnit4 to JUnit5 using VertX I read the migration guides which explain:</p>

<ul>
<li>how to use the changed <code>Promise</code> and <code>Future</code> Vertx interfaces</li>
<li>how to <code>VertxTestContext</code>, <code>Vertx</code> auto-injection in Vertx Tests</li>
<li>how to use <code>testContext.awaitCondition()</code>, <code>textContext.completing()</code>, <code>testContext.completeNow()</code> etc.</li>
</ul>

<p>Having this information in mind I wrote the following test:</p>

<p><strong>Test Code:</strong></p>

<pre><code>import io.vertx.core.Promise;
import io.vertx.core.Future;

@ExtendWith(VertxExtension.class)
class RestApiTest {

    @BeforeAll
    static void setUpMongoDatabase() throws IOException {
        (...)
    }

    @BeforeEach
    void setUp(Vertx vertx, VertxTestContext ctx) {
        vertx.deployVerticle(ApiVerticle.class.getName(), options, ctx.completing());
        return WebClient.create(vertx);
    }

    @AfterEach
    void tearDown(Vertx vertx, VertxTestContext testContext) {
        assertThat(vertx.deploymentIDs().size(), is(equalTo(2)));
    }

    @AfterAll
    static void stopMongoDatabase() {
        (...)
    }

    @Test
    void test(Vertx vertx, VertxTestContext testContext) {
        Future&lt;Void&gt; insertFuture = insertTestData();
        future.setHandler(testContext.completing());
        // This ether throws a TimeoutException or does not block until the insert completed
        testContext.awaitCompletion(5, TimeUnit.SECONDS);
        // assert
        mongoClient.findOne(COLLECTION, QUERY, result -&gt; {
             if (result.succeeded()) testContext.completeNow();
             else testContext.failNow();
        });
    }

    Future&lt;Void&gt; insertTestData() {
        Promise&lt;Void&gt; promise = Promise.promise();
        Future&lt;Void&gt; future = promise.future();
        mongoClient.insert(COLLECTION, QUERY, result -&gt; {
            if (result.succeeded()) {
                promise.complete();
            } else {
                promise.fail();
            }
        });
        return future;
    }
}
</code></pre>

<p><strong>Problem:</strong></p>

<ul>
<li>testContext.awaitCompletion() <strong>ether throws a <code>TimeoutException</code></strong></li>
<li>or <strong>does not block until the async insert completed</strong> so that my assert returns successfully</li>
</ul>

<p><strong>Question:</strong></p>

<ul>
<li>How can I wait for the async mongo query to complete before I continue with my test?</li>
</ul>

