MongoDB Mongoose aggregate query deeply nested array remove empty results and populate references<p>This question is a follow up to a <a href="https://stackoverflow.com/questions/59165880/mongodb-mongoose-querying-a-deeply-nested-array-of-subdocuments-by-date-range">previous question</a> for which I have accepted an answer already. I have an aggregate query that returns the results of a deeply nested array of subdocuments based on a date range. The query returns the correct results within the specified date range, however it also returns an empty array for the results that do not match the query.</p>

<p>Technologies: MongoDB 3.6, Mongoose 5.5, NodeJS 12</p>

<p><strong>Question 1:</strong>
Is there any way to remove the results that don't match the query?</p>

<p><strong>Question 2:</strong>
Is there any way to 'populate' the Person db reference in the results? For example to get the Person Display Name I usually use 'populate' such as <code>find().populate({ path: 'Person', select: 'DisplayName'})</code> </p>

<p><strong>Records schema</strong></p>

<pre><code>let RecordsSchema = new Schema({
  RecordID: {
    type: Number,
    index: true
  },
  RecordType: {
    type: String
  },
  Status: {
    type: String
  },
  // ItemReport array of subdocuments
  ItemReport: [ItemReportSchema],
}, {
  collection: 'records',
  selectPopulatedPaths: false
});

let ItemReportSchema = new Schema({
  // ObjectId reference
  ReportBy: {
    type: Schema.Types.ObjectId,
    ref: 'people'
  },
  ReportDate: {
    type: Date,
    required: true
  },
  WorkDoneBy: [{
    Person: {
      type: Schema.Types.ObjectId,
      ref: 'people'
    },
    CompletedHours: {
      type: Number,
      required: true
    },
    DateCompleted: {
      type: Date
