Iterate over Objects in Meteor Blaze<p>I have a data structure that is a nested object. Its a map that has unique id keys.</p>

<p>Each key then contains another map which consists of another set of unique id keys (_id corresponding to Mongo documents). And each one of these keys contains a Mongo Document.</p>

<p><a href="https://i.stack.imgur.com/1IeTJ.jpg" rel="nofollow noreferrer">https://i.stack.imgur.com/1IeTJ.jpg</a> is an example of how the data structure looks like in Chrome dev tools.</p>

<p>I want to iterate over this in Blaze. My goal is to have a header that displays the top-level keys (1 &amp; 2 in this example)and then for each top level-key, have a table where each row is a nested document.</p>

<p>I understand that Blaze can only iterate through arrays and cursors and not JS Objects. <a href="https://github.com/meteor/meteor/issues/3884" rel="nofollow noreferrer">https://github.com/meteor/meteor/issues/3884</a> And so I used _.pair to serialize my nested object into an array and here's my result
<a href="https://i.stack.imgur.com/qojXj.jpg" rel="nofollow noreferrer">https://i.stack.imgur.com/qojXj.jpg</a></p>

<p>Im having trouble getting what I want with the 2D array though. Because now my top-level key (1 &amp; 2 in this example) are at the first index of an array. I cant figure out how to access this inside an each.</p>

<p>Heres my full goal in a nutshell
I.e. </p>

<pre><code>{{#each 2dArray}}
    print {{this[0]}}
    &lt;table&gt;
        {{#each this[1]}}
            &lt;tr&gt;{{nestedThis.data}}&lt;/tr&gt;
        {{/each}}
   &lt;/table&gt;
{{/each}}
</code></pre>

<p>Does anybody know how to do this or is there a better way to structure my data too? Thanks</p>

